class SoundController {
  constructor() {
    this.soundList = {
      shine:
        'data:audio/mpeg;base64,',
      message1:
        'data:audio/mpeg;base64,',
      message2:
        'data:audio/mpeg;base64,',
      message3:
        'data:audio/wav;base64,',
    }
    this.playing = false
  }
  async play(type) {
    if (this.playing) return

    const audio = document.createElement('audio')
    if (type === 'shine') audio.src = this.soundList.shine
    if (type === 'message')
      audio.src = settings.get('userMusic') ? `${settings.get('userMusic')}` : this.soundList[settings.get('variableMusic')]

    audio.style.display = 'none'
    document.body.appendChild(audio)

    this.playing = true

    try {
      await audio.play()
      await new Promise((resolve) => {
        audio.addEventListener('ended', resolve, { once: true })
      })
    } catch (e) {
      console.error('Ошибка воспроизведения:', e)
    } finally {
      this.playing = false
      audio.remove()
    }
  }
}
